import React from "react";

const CartPage = ({ cartItems }) => {
  const cart = cartItems.map((item) => {
    return (
      <>
        <div className="cart-item">
          <img src={require(`../img/${item.image}`)} alt={item.name} />
        </div>
      </>
    );
  });
  return (
    <>
      <h4>Your Cart</h4>
      {cart}
    </>
  );
};

export default CartPage;
